import React from "react";
import './styles.css'

const Dropdown = ({customStyle, customData}) => {
return(
      <div className="dropdown-container" style={customStyle}>
            <div className="dropdown-arrow-top"></div>
           {customData.data}
      </div>
)
}

export default Dropdown
